import React, { Component, lazy, Suspense } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"
import Operators from "./components/Operator"
const viewbyfaction = true;
const viewbyrelease = true;
const viewall = true;

const routes = [
  {
    path: "/",
    component: Operators,
    viewbyfaction: viewbyfaction
  },
  {
    path: "/operators",
    component: Operators,
    viewbyfaction: viewbyfaction
  },
  {
    path: "/operators/faction",
    component: Operators,
    viewbyfaction: viewbyfaction
  },
  {
    path: "/operators/release",
    component: Operators,
    viewbyrelease: viewbyrelease
  },
  {
    path: "/operators/all",
    component: Operators,
    viewall: viewall
  }
]

class App extends Component {
  render() {
    return (
      <Router>
        {routes.map(({ path, component, viewbyfaction, viewbyrelease, viewall}) => (
          <Route
          path={path}
          render={(props) => <Operators {...props} viewbyfaction={viewbyfaction} viewbyrelease={viewbyrelease} viewall={viewall}/>}
          />
        ))}
      </Router>
    )
  }
}

export default App;
